import { Routes, Route, BrowserRouter } from 'react-router-dom';

import './App.css';
import Landing from './components/Landing';
import Links from './components/Links';
import SkillsAndInterests from './components/SkillAndInterests';
import Projects from './components/Projects';


function Root() {
  return (
    <div className="Root">
      <a href="https://github.com/NicholasLe04/portfolio"><img src="https://cdn-icons-png.flaticon.com/256/25/25231.png" height="75px" width="75px"/></a>
      <Routes>
        <Route path="/" exact element={<Landing />} />
        <Route path="/skills-and-interests" element={<SkillsAndInterests />} />
        <Route path="/links" element={<Links />} />
      </Routes>
    </div>
  );
}

function App() {
  return (
    <BrowserRouter>
      <Root/>
    </BrowserRouter>
  );
}

export default App;
